VALUES ('3274661075418', 'Batonnets glaces So Twist OASIS', 'sorbet multifruits 70,9% : eau ; jus et purées de fruits à base de concentrés 25,3% (orange 1 3,3%, pomme 7,6%, fruits de la passion 0,9%, banane 0,9%, citron 0,6%, raisin blanc 0,5%, mangue 0,4%, abricot 0,3%, pêche 0,3%, ananas 0,3%, poire 0,2%) ; sucre ; acidifiant : acide citrique ; arôme naturel ; stabilisant : gomme tara ; colorants : caroténoïdes, riboflavine ; vitamine C ; niacine ; vitamine E ; acide pantothénique ; vitamine B2 ; vitamine B6 ; vitamine BI ; acide folique ; biotine ; vitamine BI 2. Sorbet mangue 9,7% : eau ; purée de mangue 20% ; sucre ; acidifiant : acide citrique ; stabilisant : gomme tara ; arôme naturel ; jus de betterave concentré. Sorbet fruits de la passion 9,7% : eau, jus de fruits de la passion à base de concentré 20% ; sucre ; jus de betterave concentré ; acidifiant : acide citrique ; stabilisant : gomme tara ; arôme naturel. Sorbet ananas 9,7% : eau ; jus d\'ananas à base de concentré 20% ; sucre ; arôme naturel ; acidifiant : acide citrique ; stabilisant : gomme tara ; colorant : riboflavine. Les colorants d\'origine naturelle de ce produit peuvent tacher. CONSERVATION : plusieurs mois dans votre congélateur à -180C. NE JAMAIS RECONGELER UN PRODUIT DÉCONGELÉ.', 'https://static.openfoodfacts.org/images/products/327/466/107/5418/front_fr.12.400.jpg', '0', '0', '21.3', '21.3', '0.1', '0.1', '0', '0', '', '1');

