INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3274661080672', 'Pilpa bûche citron meringue', 'meringue 21,6% [sucre, blanc d\'œuf sucré (blanc d\'œuf , sucre), eau, blanc d\'œuf en poudre ; gélifiants : E412 et E4151, lait écrémé réhydraté, eau, jus de citron à base de concentré sauce citron 8,6* (sirop de glucose-fructose, jus de citron à base de concentré 1,6%, eau, sucre, amidon modifié de maïs, jaune d\'œuf en poudre, beurre ; gélifiant : E412 ; arôme naturel ; colorants : EIOO et E160b), sucre, sirop de glucose-fructose, sirop de glucose, graisse végétale de coprah, lactose et protéines de lait, morceaux de meringue enrobés de beurre de cacao 0,6% [meringue 0,5% (sucre, blanc d\'œuf, amidon de blé), beurre de cacao 0,1%, sucre] ; émulsifiants : E471 et E472b ; gélifiants : E410 et E412 ; arôme naturel de citron ; colorants : E160b et EIOO ; arôme naturel (contient lait). Les pourcentages sont exprimés sur le produit fini. Traces éventuelles d\'arachides, de soja et de fruits à coque. Certains ingrédients ne proviennent pas de France. CONSEIL DE DÉGUSTATION : PILPA voUs conseille de sortir votre bûche glacée du congélateur quelques minutes avant de la déguster. Afin de la préserver, un pic bleu est présent. Retirez-le en le tournant de droite à gauche tout en le tirant vers le haut délicatement. CONSERVATION : au congélateur* ** à -1ëOC jusqu\'à la date de durabilité minimale. NE JAMAIS RECONGELER UN PRODUIT DECONGELÉ. A consommer de préférence avant fin : voir côté.', '', '4.2', '3.5', '33.8', '29.6', '0.2', '2.6', '0.07', '0.0275590551181102', '', '0');

